import axios from "axios";
const URL = 'http://localhost:5000/api/note/'

const getNotes = async (token) => {
  const config = {
    headers: {
      authorization: 'Bearer ' + token
    }
  }

  const res = await axios.get(URL)
  return res.data
}

const noteService = {
  getNotes
}

export default noteService
